import Banner from '../components/Banner';
import Booking from '../components/Booking';

import Reviews from '../components/Reviews';
import Benefit from '../components/Benefit';

const Home = () => {
	return (
		<>
			<Banner />
			<Booking />
			<Reviews />
			<div class='max-w-5xl mx-auto py-14 px-4 lg:px-0'>
				<h3 class='font-semibold text-2xl text-gray-800 border-b border-gray-300 pb-3'>
					Traveling with Airbnb
				</h3>
				<Benefit
					title='24/7 customer support'
					description="Day or night, we're here for you. Talk to our support team from anywhere in the world, any hour."
				/>
				<Benefit
					title='24/7 customer support'
					description="Day or night, we're here for you. Talk to our support team from anywhere in the world, any hour."
				/>
				<Benefit
					title='24/7 customer support'
					description="Day or night, we're here for you. Talk to our support team from anywhere in the world, any hour."
				/>
			</div>
		</>
	);
};

export default Home;
